function App() {
  const categories = [
    {
      id: 1,
      title: "Hats",
    },
    {
      id: 2,
      title: "Jackets",
    },
    {
      id: 3,
      title: "Sneakers",
    },
    {
      id: 4,
      title: "Womens",
    },
    {
      id: 5,
      title: "Mens",
    },
  ];

  return (
    <div className="app-container">
      Pijamas Jeffinner
      <div className="container-category">
        {categories.map((item) => (
          <div className="container-body-container">
            <h2>{item.title}</h2>
            <p>Shop now</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
